# %% [markdown] id="IVlSruqcarHY"
# Для автоматического машинного обучения (AutoML) в Keras существует множество библиотек:
#
# * **AutoKeras**. Разработана специально для Keras. Умеет автоматически определять архитектуру нейронной сети и настраивает ее гиперпараметры.
#
# * **Keras Tuner**. Библиотека для настройки гиперпараметров моделей Keras. Предоставляет механизмы для выбора лучшей комбинации гиперпараметров, включая случайный поиск, решетчатый поиск и байесовский поиск.
#
# * **Hyperas**. Библиотека автоматической настройки гиперпараметров Keras с использованием решетчатого поиска. Hyperas позволяет определить границы для гиперпараметров, которые нужно настроить, и выполняет автоматическую настройку на основе заданной функции оценки.
#
# * **Talos**. Библиотека AutoML для Keras, которая использует байесовскую оптимизацию для выбора наилучших гиперпараметров модели.
#

