# %% [markdown] id="pToXxo0xIb_n"
# ### Что такое Auto Keras?

# %% [markdown] id="Ra2A_REnIIhT"
# Auto-Keras - это библиотека, предоставляющая возможность автоматизировать процесс создания глубоких нейронных сетей без участия человека. Она позволяет быстро и эффективно находить лучшие гиперпараметры модели на основе различных алгоритмов оптимизации и случайного поиска.
#
# Основная идея Auto-Keras заключается в том, чтобы автоматически находить наиболее эффективные архитектуры глубоких нейронных сетей на основе процесса обучения с подкреплением (reinforcement learning). В процессе работы Auto-Keras генерирует случайные архитектуры сетей и оценивает их производительность на основе метрик, заданных пользователем. Затем происходит отбор лучших моделей и дальнейшая оптимизация гиперпараметров, таких как количество слоев, их тип, количество нейронов в каждом слое, функции активации и т.д.
#
# Auto-Keras использует набор примитивов, позволяющих генерировать различные архитектуры нейронных сетей, основанных на классических методах, таких как сверточные нейронные сети (Convolutional Neural Networks, CNN) и рекуррентные нейронные сети (Recurrent Neural Networks, RNN), а также на более современных методах, таких как ResNet, DenseNet и даже Bert. При этом процесс генерации новых моделей может занимать много времени и ресурсов.
#
# Auto-Keras поддерживает использование как CPU, так GPU и TPU, что позволяет быстрее обрабатывать большие объемы данных. Кроме того, библиотека предоставляет удобный интерфейс для интеграции с другими библиотеками, такими как Keras и TensorFlow, что позволяет использовать уже готовые модели и переносить результаты между различными проектами.

