# %% [markdown] id="IkT95g0s9RQc"
# Таким образом AutoKeras заточен на решение задач классификации и регрессии с текстовыми данными или изображениями, а также их комбинациями.
#
# Многозадачность в данном случае означает, что мы хотим предсказать несколько объектов с одинаковыми входными характеристиками. Например, мы не только хотим классифицировать изображение в соответствии с его содержимым, но и регрессировать его качество в виде числа с плавающей запятой от 0 до 1.
#
# Как видно из диаграммы, можно создавать модели, которые будут получать на вход одновременно два сигнала - изображения и числовые входные данные.
#
# Каждое изображение связано с набором атрибутов в числовых входных данных. На основе этих данных мы пытаемся предсказать классификационную метку и значение регрессии одновременно.
#
# Также важно напомнить, что отличие между классификацией и регрессией заключается в том, как модель выдает результат предсказания в виде вероятности принадлежности к каждому из классов (выходной слой содержит нейронов по числу классов), либо числа от 0 до 1 (выходной слой представлен одним нейроном).

