# %% [markdown] id="LdjADU26Fref"
# Далее необходимо создать одну из возможных моделей AutoKeras. Так как у нас задача классификации текстов, то мы создаем модель `TextClassificator`. Модели AutoKeras имеют следующие параметры:

# %% [markdown] id="f4qpTFDAFZuM"
# * **num_classes**. Целое число классов (`int`). По умолчанию `None`. Если `None`, то оно будет получено из данных.
# * **multi_label**. Булев тип (`bool`). Если `True`, то задача считается мульти-лейбл классификацией, в которой каждый объект может иметь несколько меток (классов) из множества возможных меток. Если `False` (по умолчанию), то каждый объект имеет только одну метку из возможных.
# * **loss** Функция потерь Keras. По умолчанию используется `binary_crossentropy` или `categorical_crossentropy` в зависимости от количества классов.
# * **metrics** Необязательный параметр, может принимать список метрик Keras, в виде строки, функции или экземпляра метрики, список списков метрик или словарь с именованными метриками. По умолчанию используется метрика `accuracy`.
# * **project_name**. Строка (`str`). Название AutoModel. По умолчанию установлено значение по имени модели.
# - **max_trials**. Целое число (`int`). Максимальное количество разных моделей Keras, которые будут протестированы. Поиск может завершиться до достижения максимального количества проб. По умолчанию равен 100.
# - **directory**. Путь к директории для сохранения результатов поиска. По умолчанию значение `None`, что создает папку с именем AutoModel в текущей директории.
# - **objective**. Название метрики модели для минимизации или максимизации, например, `val_accuracy`. По умолчанию устанавливается `val_loss`.
# - **tuner**. Строка или подкласс AutoTuner. Если строка, то должна быть одной из значений: `greedy`, `bayesian`, `hyperband` или `random`. Она также может быть подклассом AutoTuner. Если не указано, то используется тюнер, специфичный для задачи, который сначала оценивает наиболее часто используемые модели для задачи, прежде чем исследовать другие модели.
# - **overwrite**. Булевое значение (`bool`). По умолчанию `False`. Если `False`, загружает существующий проект с тем же именем, если такой найден. В противном случае перезаписывает проект.
# - **seed**. Это целочисленный параметр, который устанавливает случайное начальное значение для генератора случайных чисел, используемого во время обучения модели. Это позволяет воспроизводить результаты обучения на разных машинах и улучшает воспроизводимость результатов.
# - **max_model_size**. Целое число. Максимальное количество скалярных параметров в модели. Модели, размер которых превышает это значение, отбрасываются.
# - **kwargs**. Этот параметр относится к конструктору AutoModel и позволяет указать любые аргументы, поддерживаемые этим классом. Класс AutoModel является базовым классом для всех поддерживаемых моделей в AutoKeras, таких как ImageClassifier, TextClassifier и другие. Конкретный список аргументов, поддерживаемых AutoModel, зависит от конкретного класса модели, который используется. В общем, аргументы могут включать в себя параметры для слоев, оптимизаторов, регуляризации и других компонентов модели.

# %% colab={"base_uri": "https://localhost:8080/"} id="3azfnSIYBtWy" outputId="9f8837b8-ae0c-4f3a-8461-6fad15c9c505"
