# %% [markdown] id="iZSDgf_Snf5s"
# При использовании моделей классификации в машинном обучении есть три общих показателя, которые используются для оценки качества модели:
#
# 1. **Точность (precision)** - процент правильных положительных прогнозов по отношению к общему количеству положительных прогнозов.
#
# 2. **Полнота (recall)** - процент правильных положительных прогнозов по отношению к общему количеству фактических положительных результатов.
#
# 3. **Оценка F1** - средневзвешенное гармоническое значение точности и полноты. Чем ближе к 1, тем лучше модель.
#
# 4. **Поддержка (support)** - сколько примеров попало в заданный класс.
#
# ```python
# Оценка F1 = 2 * (Точность * Полнота) / (Точность + Полнота)
# ```
#
# Функцию `classification_report` из библиотеки `sklearn` вычисляет все эти показателя.

