# ### Ручная "подстройка" модели

# %% [markdown] id="VFtlKSsLEo4f"
# Для опытных пользователей Keras предлагает настроить пространство поиска, используя `Automodel` вместо `TextClassifier`.
#
# Нам всего лишь нужно указать, что на входе будут текстовые данные (`TextInput`), что текст необходимо еще превратить в токены (векторизация текста). Далее мы показываем модели, что дальше нам нужны текстовые блоки (`TextBlock`), которые реализуются с помощью эмбедингов, плюс дополнительных слоев, которые подберет фреймворк. Выходной слой представлен `ClassificationHead`. Фреймворк самостоятельно по числу классов установит необходимое число нейронов и задаст функции активации.

# %% id="wvbYwcKIEr59" colab={"base_uri": "https://localhost:8080/"} outputId="eed61eac-0829-48fb-f22c-761335dab197"
# Входной слой обработки текста (векторизация)
input_node = ak.TextInput()
# Здесь идет подбор слоев для работы с текстом
output_node = ak.TextBlock()(input_node)
# Выходной слой должен обеспечивать классификацию
output_node = ak.ClassificationHead()(output_node)
# Собираем модель, аналогично как мы это делали для Keras functional API, используем 2 модели (max_trials=2)
clf_2 = ak.AutoModel(
    inputs=input_node, outputs=output_node, overwrite=True,  max_trials=2, objective='val_accuracy'
)
# Обучаем 2 пободранных модели на 3 эпохах
res_2 = clf_2.fit(X_train, y_train, epochs=3)

