# # Keras Tuner

# %% [markdown] id="Pa3j0uCIH0ug"
# **Keras Tuner** - это библиотека, которая помогает выбрать оптимальные гиперпараметры для моделей, созданных с помощью Keras. Это позволяет автоматизировать процесс оптимизации гиперпараметров, что может существенно сократить время и усилия, затраченные на поиск лучшей модели.
#
# [Официальная документация](https://keras.io/keras_tuner/).
#
# Библиотека поддерживает несколько стратегий поиска гиперпараметров, включая случайный поиск, решетчатый поиск и поиск по градиентам.
#
# Основные компоненты Keras Tuner:
#
# * **HyperModel** - класс, который определяет архитектуру модели, которую нужно настроить. Обычно он наследуется от класса keras.Model.
# * **HyperParameters** - класс, который определяет гиперпараметры, которые необходимо настроить. Он содержит методы для определения типов гиперпараметров, их диапазонов значений и других характеристик.
# * **Tuner** - класс, который определяет стратегию поиска гиперпараметров. Он принимает на вход объект **HyperModel** и **HyperParameters**, а затем настраивает гиперпараметры, используя выбранную стратегию поиска. Результатом работы **Tuner** является оптимальный набор гиперпараметров.
# * **Oracle** - класс, который определяет правила остановки поиска. Он определяет, когда поиск должен быть остановлен на основе заданных условий, таких как количество итераций или улучшение метрики.
# * **Callbacks** - классы обратного вызова, которые можно использовать для мониторинга и сохранения состояния поиска.
#
# Библиотека Keras Tuner построена на понятии тюнера. Тюнеры содержаться в подмодуле `kerastuner.tuners`, который содержит различные классы тюнеров для поиска оптимальных гиперпараметров моделей Keras.
#
# Тюнеры Keras Tuner позволяют оптимизировать гиперпараметры модели, выбирая наиболее перспективные варианты из заданного диапазона значений. В этом процессе тюнер автоматически обучает и оценивает модели с разными комбинациями гиперпараметров и выбирает лучшую на основе заданной метрики.
#
# Классы тюнеров в `kerastuner.tuners` включают в себя:
#
# * **RandomSearch** - ищет лучшие гиперпараметры, выбирая их случайным образом из заданного диапазона значений.
# * **Hyperband** - комбинация методов градиентной оптимизации и оптимизации гиперпараметров. Этот тюнер использует алгоритм Hyperband для поиска наиболее перспективных моделей для данной задачи и оптимизации гиперпараметров только для них.
# * **BayesianOptimization** - использует байесовскую оптимизацию для поиска лучших гиперпараметров.
# * **Sklearn** - тюнер для моделей, совместимых со Scikit-Learn. Он использует случайный поиск или генетические алгоритмы для оптимизации гиперпараметров.
#
# После того как тюнер завершит процесс подбора наилучших гиперпараметров, он возвращает модель Keras, которая может быть использована для обучения на данных.

# %% id="EH_wVM6nQV46" colab={"base_uri": "https://localhost:8080/"} outputId="b9d89ac1-9819-4e7a-88c4-19a0c6d52c61"
# !pip install keras-tuner

# %% id="LZCkJmSy0O10" colab={"base_uri": "https://localhost:8080/"} outputId="c3c197f3-b037-43f7-96ee-db975459488f"
# Библиотека для работы с фреймворком TensorFlow
import tensorflow as tf

# Импортируем фреймворк Keras
import keras

# Для работы с слоями
from keras import layers

# Тюнеры для KerasTuner
from kerastuner.tuners import RandomSearch
from kerastuner.engine.hyperparameters import HyperParameters

# Для быстрой векторизации слов
from tensorflow.keras.preprocessing.text import one_hot

# Выравнивание последовательностей по длиине
from keras.preprocessing.sequence import pad_sequences

# %% id="n0rUf-lp0Omy"
# Задаем размер словаря
vocab_size = 10000

# Выравниваем входные последовательности до заданной длины
sentence_len = 25

# Функция предобработки данных
def data_preparation(data):
    corpus=[]

    for text in data:
        # убираем из текстов все, что не является буквами
        text=re.sub("[^a-zA-Z]", " ", text)
        # Убираем все заглавные буквы
        text=text.lower()
        # Избавляемся от лишних пробелов
        text=text.split()
        text=" ".join(text)
        corpus.append(text)

    # Векторизуем текст
    oneHot_doc=[one_hot(input_text=words, n=vocab_size)
               for words in corpus
               ]
    # обрезаем или забиваем нулями до заданной длины входные последовательности
    embedded_doc=pad_sequences(sequences=oneHot_doc,
                              maxlen=sentence_len,
                              padding="post")
    return embedded_doc


# %% id="0ws_xxlF0UDr"
# Запускаем предобработку данных
train_data = data_preparation(X_train)
test_data = data_preparation(X_test)

# %% id="VLf_KiJV5M6r" colab={"base_uri": "https://localhost:8080/", "height": 36} outputId="0afd947f-6c61-4f40-aa49-cf28f30bb1f8"
# Вывод первого заголовка обучающей выборки в исходном виде
X_train[0]

# %% id="U-Sfedcd6XCO" colab={"base_uri": "https://localhost:8080/"} outputId="02c9cf91-7b64-4a31-dbfb-8b7c26634e79"
# Вывод первого заголовка обучающей выборки в векторизованном виде
train_data[0]


# %% id="2CVOnhdj0XgU"
# Определение функции для построения модели
def build_model(hp):
    model = keras.Sequential()
    # Добавление слоев эмбеддинга
    model.add(layers.Embedding(input_dim=vocab_size,
      output_dim=hp.Int('embedding_dim', min_value=8, max_value=32, step=8) # задаем диапазон изменения параметра embedding_dim
    ))
    model.add(layers.GlobalAveragePooling1D())

    # Задаем количество слоев, их размерности и функции активации
    for i in range(hp.Int('num_layers', 1, 4)): # число слоев
        model.add(layers.Dense(units=hp.Int('units_' + str(i), 32, 256, 32), # размерность
                               activation=hp.Choice('activation_' + str(i), ['relu', 'tanh', 'sigmoid']))) # подбор функции активации
    model.add(layers.Dense(1, activation='sigmoid')) # Выходной слой

    # Определение оптимизатора и скомпилирование модели
    # learning_rate - выбирается из списка [1e-3, 1e-4, 1e-5]
    model.compile(optimizer=keras.optimizers.Adam(hp.Choice('learning_rate', [1e-3, 1e-4, 1e-5])),
                  loss=keras.losses.BinaryCrossentropy(),
                  metrics=['accuracy'])

    return model


# %% [markdown] id="dVEUYiL4QrOJ"
# Когда модель определена, можно переходить к подбору параметров. Мы используем класс `RandomSearch` из Keras Tuner для настройки гиперпараметров. Метод search запускает процесс настройки, в котором модели обучаются на обучающем наборе данных и проверяются на проверочном наборе данных для оценки их производительности. Мы указываем максимальное количество испытаний (`max_trials`), которые хотим выполнить, а также папку `directory` и имя проекта `project_name`, в которых будут храниться результаты настройки.
#
# После того, как настройка завершена, мы получаем наилучшую модель с помощью метода `get_best_models`. Затем мы оцениваем производительность этой модели на тестовом наборе данных с помощью метода `evaluate`.

# %% id="FhpDev8YQawv" colab={"base_uri": "https://localhost:8080/"} outputId="52011a4e-c68a-48b8-fb12-7a192f175905"
# Определение гиперпараметров для настройки
tuner_search = RandomSearch(build_model,
                            objective='val_accuracy',
                            max_trials=10,
                            directory='output')

# Запуск настройки гиперпараметров
tuner_search.search(train_data, y_train, epochs=5, validation_split=0.2)

# Получение наилучшей модели
best_model = tuner_search.get_best_models(num_models=1)[0]

# Оценка наилучшей модели на тестовых данных
test_loss, test_accuracy = best_model.evaluate(test_data, y_test)
print('Test accuracy:', test_accuracy)

